package Basic;

public class wrapperdemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//primitive-> object
		int x=40;
		Integer y=x;
		System.out.println("y="+x);//autoboxing, converting primitive to object

		double m=10.2;
		Double n=m;
		System.out.println("n="+m);//unboxing, converting object to primitive
	
		
		
		
		
	}

}
